import { administration } from "../../env/environment";
import { default as loginPage } from "../../pageobjects/administration.page/Login.page";
import { verifyIsNotVisible, waitForLoader } from "../../pageobjects/common/Common.page";
import agencyWizard from "../../pageobjects/administration.page/agencyWizard.page";
import { expect } from "chai";
import waitForClickable from "webdriverio/build/commands/element/waitForClickable";

describe("Administration - Agency Wizard", () => {
    it("Login", () => {
        administration();
        browser.maximizeWindow();
        loginPage.usernameInput.setValue("DSuperAdminQA");
        loginPage.passwordInput.setValue("mono.123");
        loginPage.signInBtn.click();
    });

    it("AgencyWizard", () => {
        const agencyWizardButton = $(
            'div:nth-of-type(2) > .quicklinks__btn > .quicklinks__btn__text' // agency wizard link
        );
        agencyWizardButton.click();

        const randomStringNum = String(Math.random()).slice(2, -1);
        agencyWizard.nameInput.waitForDisplayed();
        agencyWizard.nameInput.addValue(`AT${randomStringNum}`);

        const centralButton = $("[class='f-col f-col-sml-12 f-col-med-12 f-col-lrg-6 f-col-xlrg-6 at-central'] .k-textbox-container");
        centralButton.click();
        $(".k-child-animation-container").$("li*=CypressCentral").click();  // select test central

        const serverButton = $("[class='f-col f-col-sml-12 f-col-med-12 f-col-lrg-6 f-col-xlrg-6 at-servers'] .k-textbox-container");
        serverButton.click();
        $(".k-child-animation-container").$("li*=db.gp.develop").click();  // select server

        const nextButton = $(`button[title='Next']`);   // next button
        nextButton.click();
        nextButton.click();

        const done = $("div*=Done");
        done.waitForDisplayed({ timeout: 600000 });


        const continueButton = $(".btn.btn--med.btn--primary");  // continue button
        continueButton.waitForEnabled({ timeout: 5000 });
        continueButton.click();

        agencyWizard.shopNameInput.addValue(`ATShop${randomStringNum}`);

        const shopType = $(`.form--grid.view--wizard__form span[role='listbox'] > .k-select`);
        shopType.click();

        /*const cardsWithoutDeposit =$(`/html//div[@id='root']//div[@class='layout']/div[@class='layout__content msg-panel-expanded']//div[@class='container']/div[5]/div[4]/div[@class='form__group form__group--checkbox']/input[@class='input--checkbox']`); // withoutdeposit čvak
        cardsWithoutDeposit.click(); */

        //browser.elementClick(`isAnonymousPaymentEnabled--465`);

        const finishButton = $(`.f-col.type--right > button[title='Finish']`);  // Finish button
        finishButton.click();


        const successfullToast = $(`.Toastify__toast.Toastify__toast--default.green-background`).$("div*=Shop created successfully");     // verify green toast
        successfullToast.waitForDisplayed();
        expect(successfullToast).to.exist;
    });
});

