import { expect } from "chai";
import { administration, webML } from "../../env/environment";
import { randomStringNum, verifyElementValue, verifyIsVisible } from "../../pageobjects/common/Common.page";
import { loginWebV1Page, MenuItemsPage } from "../../pageobjects/web-v1";
import PersonalDataPage from "../../pageobjects/web-v1/PersonalData.page";

describe("Web ML - Personal data tests", () => {

    const username = "at-pd1";
    const password = "mono.123";

    it("Open personal data page, verify it is opened", () => {
        webML();
        browser.maximizeWindow();
        loginWebV1Page.usernameInput.addValue(username);
        loginWebV1Page.passwordInput.addValue(password);
        loginWebV1Page.signInBtn.click();
        verifyIsVisible(loginWebV1Page.logoutBtn);
        MenuItemsPage.accountSettingsBtn.click();
    });

    it("Change country, verify it is updated", () => {
        const dataupdatedInfo = $("div=Data successfully updated");
        const infoCloseBtn = $("#accSettingsForm .popup:nth-child(5) .btn--icon-left");
        const selectBangladesh = $("option=Bangladesh");
        const selectCroatia = $("option=Croatia");
        PersonalDataPage.addressSectionEditBtn.click();
        PersonalDataPage.countryDropdown.click();
        selectBangladesh.click();


        PersonalDataPage.saveBtn.click();

        PersonalDataPage.personalDataPasswordConfirmationInput.waitForClickable(password)
        PersonalDataPage.personalDataPasswordConfirmationInput.addValue(password)
        PersonalDataPage.personalDataPasswordConfirmationSaveBtn.click();

        dataupdatedInfo.waitForDisplayed();
        verifyIsVisible(dataupdatedInfo);
        infoCloseBtn.click();
        PersonalDataPage.addressSectionEditBtn.waitForClickable();
        PersonalDataPage.addressSectionEditBtn.click();
        PersonalDataPage.countryDropdown.click();
        selectCroatia.click();
        PersonalDataPage.saveBtn.click();

        PersonalDataPage.personalDataPasswordConfirmationInput.waitForClickable(password)
        PersonalDataPage.personalDataPasswordConfirmationInput.addValue(password)
        PersonalDataPage.personalDataPasswordConfirmationSaveBtn.click();
        dataupdatedInfo.waitForDisplayed();
        verifyIsVisible(dataupdatedInfo);
        infoCloseBtn.click();
    });

    it("Change address section", () => {
        const dataupdatedInfo = $("div=Data successfully updated");
        const infoCloseBtn = $("#accSettingsForm .popup:nth-child(5) .btn--icon-left");
        PersonalDataPage.addressSectionEditBtn.click();

        PersonalDataPage.streetInput.clearValue();
        PersonalDataPage.streetInput.addValue(randomStringNum());

        PersonalDataPage.houseNumberInput.clearValue();
        PersonalDataPage.houseNumberInput.addValue(randomStringNum());

        PersonalDataPage.zipCodeInput.clearValue();
        PersonalDataPage.zipCodeInput.addValue(randomStringNum().slice(4));

        PersonalDataPage.townCityInput.clearValue();
        PersonalDataPage.townCityInput.addValue(randomStringNum().slice(4));
        PersonalDataPage.saveBtn.click();
        PersonalDataPage.personalDataPasswordConfirmationInput.waitForClickable(password)
        PersonalDataPage.personalDataPasswordConfirmationInput.addValue(password)
        PersonalDataPage.personalDataPasswordConfirmationSaveBtn.click();

        dataupdatedInfo.waitForDisplayed();
        verifyIsVisible(dataupdatedInfo);
        infoCloseBtn.click();
        PersonalDataPage.addressSectionEditBtn.click();

        PersonalDataPage.streetInput.clearValue();
        PersonalDataPage.streetInput.addValue("StreetX");

        PersonalDataPage.houseNumberInput.clearValue();
        PersonalDataPage.houseNumberInput.addValue("houseX");

        PersonalDataPage.zipCodeInput.clearValue();
        PersonalDataPage.zipCodeInput.addValue("zipXXX");

        PersonalDataPage.townCityInput.clearValue();
        PersonalDataPage.townCityInput.addValue("CityX");
        PersonalDataPage.saveBtn.click();
        PersonalDataPage.personalDataPasswordConfirmationInput.waitForClickable(password)
        PersonalDataPage.personalDataPasswordConfirmationInput.addValue(password)
        PersonalDataPage.personalDataPasswordConfirmationSaveBtn.click();

        dataupdatedInfo.waitForDisplayed();
        verifyIsVisible(dataupdatedInfo);
        infoCloseBtn.click();
    });

    it("Verify street is updated", () => {
        verifyElementValue(PersonalDataPage.streetInput, "StreetX");
    });

    it("Verify house number is updated", () => {
        verifyElementValue(PersonalDataPage.houseNumberInput, "houseX");
    });

    it("Verify zip code is updated", () => {
        verifyElementValue(PersonalDataPage.zipCodeInput, "zipXXX");
    });

    it("Verify city is updated", () => {
        verifyElementValue(PersonalDataPage.townCityInput, "CityX")
    });
});

