import { mobileAdministration } from "../../env/environment";
import { mobileAdministrationSelectCompany, mobileAdministrationLogout, randomStringNum, verifyIsVisible } from "../../pageobjects/common/Common.page";
import { HomePage, MenuItemsPage, MobileAdministrationAgency, MobileAdminLoginPage } from "../../pageobjects/mobile-administration";

describe("NEW AGENCY TESTS", () => {

    it("Open agency page, verify page does not crash", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.agencyMenuItem.click();
    });

    it("Open new agency page, verify page does not crash", () => {
        MobileAdministrationAgency.newAgencyBtn.click();
        const centralName = $("span=HR Central");
        verifyIsVisible(centralName);
    });

    it("Select Central, verify page is opened", () => {
        const centralName = $("span=HR Central");
        centralName.click();
        const agencyname = $("div=MonoQA");
        verifyIsVisible(agencyname);
        verifyIsVisible(MobileAdministrationAgency.newAgency.addNewAgencyBtn);

    });

    it("Open Agency create page", () => {
        MobileAdministrationAgency.newAgency.addNewAgencyBtn.click();
    });

    it("Create an agency, verify", () => {
        const randomAgencyNum = randomStringNum();
        MobileAdministrationAgency.newAgency.agencyNameInput.addValue(`Automated${randomAgencyNum}`);
        MobileAdministrationAgency.newAgency.agencyAddressInput.addValue('address');
        MobileAdministrationAgency.selectCurrency("li=Euro (EUR)");
        /* $("[type='submit']").click();
        verifyIsVisible($("div=Agency created successfully")); */  //Remove comment if you want to create agencies
    });

    it("Logout", () => {
        mobileAdministrationLogout();
    });


});
describe("NEW AGENT PARTNER TESTS", () => {
    it("Open new agent partner page", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.agencyMenuItem.click();
        MobileAdministrationAgency.newAgentPartnerBtn.click();
    });

    it("Create agent partner", () => {
        MobileAdministrationAgency.newAgentPartner.usernameInput.addValue(`autoAgentPartner${randomStringNum()}`);
        MobileAdministrationAgency.newAgentPartner.passwordInput.addValue('mono.123');
        MobileAdministrationAgency.newAgentPartner.confirmPasswordInput.addValue('mono.123');
        MobileAdministrationAgency.newAgentPartner.firstNameInput.addValue(randomStringNum());
        MobileAdministrationAgency.newAgentPartner.lastNameInput.addValue(randomStringNum());
        const central = $('span=HR Central');
        central.click();
        const agency = $('span=MonoQA');
        agency.click();
        $("[type='submit'] .btn__label").click();
        const successToastMessage = $("div=Agency Partner created successfully");
        verifyIsVisible(successToastMessage);
        browser.pause(1000);
        mobileAdministrationLogout();
    });

});
describe("EDIT PARTNER TESTS", () => {
    it("Open Edit partner page, verify page is opened", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.agencyMenuItem.click();
        MobileAdministrationAgency.editPartnerBtn.click();
        verifyIsVisible(MobileAdministrationAgency.editPartner.userInput);
        verifyIsVisible(MobileAdministrationAgency.editPartner.filterLabel);
        verifyIsVisible(MobileAdministrationAgency.editPartner.roleDropdown);
    });

    const backButton = ".icon--nav-back--white";

    it("Verify Agent roles are filtered", () => {
        MobileAdministrationAgency.editPartner.selectRole('Agent');
        $("button[title='Search']").click();

        const firstFilteredResult = ".list--secondary__item:nth-of-type(1)";
        $(firstFilteredResult).click();

        const roleElement = $(".card--secondary__body").$("div*=Agent");
        verifyIsVisible(roleElement);
        $(backButton).click();
    });

    it("Verify Shop Manager roles are filtered", () => {
        MobileAdministrationAgency.editPartner.selectRole('Shop manager');
        $("button[title='Search']").click();
        const firstFilteredResult = ".list--secondary__item:nth-of-type(1)";
        $(firstFilteredResult).click();

        const roleElement = $(".card--secondary__body").$("div*=BettingShopManager");
        verifyIsVisible(roleElement);
        $(backButton).click();
    });

    it("Verify Cashier roles are filtered", () => {
        MobileAdministrationAgency.editPartner.selectRole('Cashier');
        $("button[title='Search']").click();
        const firstFilteredResult = ".list--secondary__item:nth-of-type(1)";
        $(firstFilteredResult).click();

        const roleElement = $(".card--secondary__body").$("div*=Cashier");
        verifyIsVisible(roleElement);
        $(backButton).click();
    });

    it("Verify Partner roles are filtered", () => {
        MobileAdministrationAgency.editPartner.selectRole('Partner');
        $("button[title='Search']").click();
        const firstFilteredResult = ".list--secondary__item:nth-of-type(1)";
        $(firstFilteredResult).click();

        const roleElement = $(".card--secondary__body").$("div*=Partner");
        verifyIsVisible(roleElement);
        $(backButton).click();
    });

    it("Verify new password was generated", () => {
        MobileAdministrationAgency.editPartner.selectRole('Partner');
        $("button[title='Search']").click();
        const firstFilteredResult = ".list--secondary__item:nth-of-type(1)";
        $(firstFilteredResult).click();

        MobileAdministrationAgency.editPartner.resetPasswordGenerateBtn.click();
        const newPasswordLabel = $("span=New Password");
        const newPasswordBox = $(".spc--top--sml");
        verifyIsVisible(newPasswordLabel);
        verifyIsVisible(newPasswordBox);
    });

    it("Verify new password can be copied", () => {
        MobileAdministrationAgency.editPartner.copyNewPasswordBtn.waitForClickable();
        MobileAdministrationAgency.editPartner.copyNewPasswordBtn.click();
        const successfullToastMessage = $("div*=copied to clipboard");
        verifyIsVisible(successfullToastMessage);
    });

    it("Verify activation and deactivation", () => {
        const lockedUserMessage = $("div=User locked successfully");
        const unlockedUserMessage = $("div=User unlocked successfully");
        MobileAdministrationAgency.editPartner.activePartnerBtn.click();
        verifyIsVisible(lockedUserMessage);
        MobileAdministrationAgency.editPartner.inactivePartnerBtn.click();
        verifyIsVisible(unlockedUserMessage);
        mobileAdministrationLogout();
    });

});
describe("DEPOSIT / WITHDRAWAL TESTS", () => {

    it("Open deposit and withdrawal page, verify page is opened", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.agencyMenuItem.click();
        MobileAdministrationAgency.depositWithdrawalBtn.click();
        verifyIsVisible(MobileAdministrationAgency.depositWithdrawal.roleDropdown);
        verifyIsVisible(MobileAdministrationAgency.depositWithdrawal.userInput);
    });

    it("Search all users, verify results are loaded", () => {
        MobileAdministrationAgency.depositWithdrawal.searchBtn.click();
        verifyIsVisible($(".list--secondary"));
    });

    it("Select a user, verify user page is opened", () => {
        const firstFilteredResult = ".list--secondary__item:nth-of-type(1)";
        $(firstFilteredResult).click();
    });

    it("Deposit to account, verify request was a success", () => {
        const value20 = $(".btn--payment__wrapper").$("div=20");
        const depositSuccessfullMessage = $("div=Deposit successful");
        const withdrawalSuccessfullMessage = $("div=Withdrawal successful");

        value20.waitForClickable();
        value20.click();
        MobileAdministrationAgency.depositWithdrawal.depositBtn.click();
        verifyIsVisible(depositSuccessfullMessage);

        MobileAdministrationAgency.depositWithdrawal.payoutBtn.waitForClickable();
        MobileAdministrationAgency.depositWithdrawal.payoutBtn.click();
        verifyIsVisible(withdrawalSuccessfullMessage);
        mobileAdministrationLogout();
    });


});
describe("AGENCY MANAGEMENT TESTS", () => {

    it("Open agency management page, verify page is opened", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.agencyMenuItem.click();
        MobileAdministrationAgency.agencyManagementBtn.click();
        verifyIsVisible($("div=Agency management"));
    });

    it("Open an agency, verify page is opened", () => {
        $("span=HR Central").click();
        $("span=AgencyMMMM").click();

        const agencyName = $(".card--secondary__body").$("div=AgencyMMMM");
        verifyIsVisible(agencyName);
    });

    it("Activate and deactivate agencies, verify messages", () => {
        const agencyDeactivatedMessage = $("div=Agency deactivated successfully")
        const agencyActivatedMessage = $("div=Agency activated successfully")
        MobileAdministrationAgency.agencyManagement.activeAgencyBtn.click();
        verifyIsVisible(agencyDeactivatedMessage);
        MobileAdministrationAgency.editPartner.inactivePartnerBtn.click();
        verifyIsVisible(agencyActivatedMessage);
        mobileAdministrationLogout();
    });


});

