import { administration } from "../../env/environment";
import { LiveOfferPage } from "../../pageobjects/administration.page";
import LoginPage from "../../pageobjects/administration.page/Login.page";
import SideMenuPage from "../../pageobjects/administration.page/SideMenu.page";
import { verifyElementValue, verifyIsNotVisible, verifyIsVisible } from "../../pageobjects/common/Common.page";

describe("Live offer tests", () => {

    it("Open live offer page, verify page is opened", () => {
        administration();
        browser.maximizeWindow();
        LoginPage.usernameInput.addValue("vikNova");
        LoginPage.passwordInput.addValue("mono.123");
        LoginPage.signInBtn.click();
        SideMenuPage.FinancesButton.waitForDisplayed();
        browser.url("http://qa.admin.gp.develop/live/list");
        verifyIsVisible(LiveOfferPage.closeAllEventsBtn);

    });

    it("Verify risk level1 is applied", () => {
        browser.url("http://qa.admin.gp.develop/platform/risk-management-limit-settings");
        // Get risk level1 Event limit value
        $(".container [class='f-col f-col-sml-12 f-col-med-12 f-col-lrg-5 spc--top--sml--to-med']:nth-of-type(2) [class='f-col f-col-sml-12']:nth-of-type(1) .f-col:nth-of-type(1) .k-formatted-value").getValue();
        let eventMaxStakeValue = $(".container [class='f-col f-col-sml-12 f-col-med-12 f-col-lrg-5 spc--top--sml--to-med']:nth-of-type(2) [class='f-col f-col-sml-12']:nth-of-type(1) .f-col:nth-of-type(1) .k-formatted-value").getValue();
        // Get risk level1 Max stake bet bet slip limit
        $(".container [class='f-col f-col-sml-12 f-col-med-12 f-col-lrg-5 spc--top--sml--to-med']:nth-of-type(3) [class='f-col f-col-sml-12']:nth-of-type(1) .f-col:nth-of-type(1) .k-formatted-value").getValue();
        let eventMaxStakePerBetSlipValue = $(".container [class='f-col f-col-sml-12 f-col-med-12 f-col-lrg-5 spc--top--sml--to-med']:nth-of-type(3) [class='f-col f-col-sml-12']:nth-of-type(1) .f-col:nth-of-type(1) .k-formatted-value").getValue();
        browser.url("http://qa.admin.gp.develop/live/list");
        verifyIsVisible(LiveOfferPage.closeAllEventsBtn);
        LiveOfferPage.endedFilterCheckbox.click();
        LiveOfferPage.liveFilterCheckbox.click();
        LiveOfferPage.stoppedFilterCheckbox.click();
        LiveOfferPage.FilterBtn.waitForClickable();
        const firstEvent = $("tr:nth-of-type(1) > td:nth-of-type(5)");
        const loadingImage = $(".k-loading-image");
        verifyIsVisible(firstEvent);
        LiveOfferPage.FilterBtn.click();
        browser.pause(2000);
        verifyIsNotVisible(loadingImage);
        firstEvent.doubleClick();

        verifyElementValue(".f-row .live-event__filters__limit .k-formatted-value", eventMaxStakeValue);
        verifyElementValue(".live-event__filters__limitslip .k-formatted-value", eventMaxStakePerBetSlipValue);
    });
});

