import { mobileAdministration } from "../../env/environment";
import { mobileAdministrationLogout, mobileAdministrationSelectCompany, randomStringNum, verifyIsVisible } from "../../pageobjects/common/Common.page";
import { MenuItemsPage, MobileAdministrationShopPage, MobileAdminLoginPage } from "../../pageobjects/mobile-administration";

describe("NEW SHOP TESTS", () => {

    it("Open new Shop page, verify page does not crash", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.shopMenuItem.click();
        verifyIsVisible(MobileAdministrationShopPage.newCashierBtn);
        verifyIsVisible(MobileAdministrationShopPage.depositWithdrawalBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartnerBtn);
        verifyIsVisible(MobileAdministrationShopPage.shopManagementBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopBtn);
        MobileAdministrationShopPage.newShopBtn.click();
    });

    it("Select central, verify agencies are loaded", () => {
        MobileAdministrationShopPage.newShop.selectCentral("HR Central");
        verifyIsVisible(MobileAdministrationShopPage.newShop.centralTitle);
    });

    it("Create shop, verify it is a success", () => {
        const agency = $(".nav--linkbox--inline").$("span*=Automated");
        agency.waitForClickable();
        agency.click();
        MobileAdministrationShopPage.newShop.addNewShopBtn.click();
        const randomShop = `Autoshop${randomStringNum()}`;
        MobileAdministrationShopPage.newShop.shopNameInput.addValue(randomShop);
        MobileAdministrationShopPage.newShop.shopAddressInput.addValue("addrX");
        MobileAdministrationShopPage.newShop.pinNumberInput.addValue("1111");
        MobileAdministrationShopPage.newShop.saveBtn.click();
        verifyIsVisible(MobileAdministrationShopPage.newShop.shopCreatedToastMessage);

        const createdShop = $(".nav--linkbox--inline").$(`div*=${randomShop}`);
        createdShop.waitForDisplayed();
        verifyIsVisible(createdShop);
        mobileAdministrationLogout();
    });


});
describe("NEW SHOP PARTNER TESTS", () => {

    it("Open new Shop partner page, verify page does not crash", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.shopMenuItem.click();
        verifyIsVisible(MobileAdministrationShopPage.newCashierBtn);
        verifyIsVisible(MobileAdministrationShopPage.depositWithdrawalBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartnerBtn);
        verifyIsVisible(MobileAdministrationShopPage.shopManagementBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopBtn);
        MobileAdministrationShopPage.newShopPartnerBtn.click();
    });

    it("Verify shop partner creation page", () => {
        verifyIsVisible(MobileAdministrationShopPage.newShopPartner.usernameInput);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartner.confirmPasswordInput);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartner.passwordInput);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartner.firstNameInput);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartner.lastNameInput);
    });

    it("Verify partner is created", () => {
        MobileAdministrationShopPage.newShopPartner.usernameInput.addValue(`partner${randomStringNum()}`);
        MobileAdministrationShopPage.newShopPartner.passwordInput.addValue('mono.123');
        MobileAdministrationShopPage.newShopPartner.confirmPasswordInput.addValue('mono.123');
        MobileAdministrationShopPage.newShopPartner.firstNameInput.addValue("aeifha");
        MobileAdministrationShopPage.newShopPartner.lastNameInput.addValue("adfawf");
        MobileAdministrationShopPage.newShopPartner.selectshop("HR Central", "MonoQA", "Vanja");
        MobileAdministrationShopPage.newShopPartner.saveBtn.click();

        verifyIsVisible($("div*=Agency Partner created successfully"));
        mobileAdministrationLogout();
    });

});

describe("NEW CASHIER TESTS", () => {
    it("Open new Shop partner page, verify page does not crash", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.shopMenuItem.click();
        verifyIsVisible(MobileAdministrationShopPage.newCashierBtn);
        verifyIsVisible(MobileAdministrationShopPage.depositWithdrawalBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartnerBtn);
        verifyIsVisible(MobileAdministrationShopPage.shopManagementBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopBtn);
        MobileAdministrationShopPage.newCashierBtn.click();
    });

    it("Verify new cashier page", () => {
        verifyIsVisible(MobileAdministrationShopPage.newCashier.usernameInput);
        verifyIsVisible(MobileAdministrationShopPage.newCashier.passwordInput);
        verifyIsVisible(MobileAdministrationShopPage.newCashier.confirmPasswordInput);
        verifyIsVisible(MobileAdministrationShopPage.newCashier.firstnameInput);
        verifyIsVisible(MobileAdministrationShopPage.newCashier.lastNameInput);
        verifyIsVisible(MobileAdministrationShopPage.newCashier.emailInput);
    });

    it("Create a new cashier", () => {
        const randomCashier = `cashier${randomStringNum()}`;
        MobileAdministrationShopPage.newCashier.usernameInput.addValue(randomCashier);
        MobileAdministrationShopPage.newCashier.passwordInput.addValue("mono.123");
        MobileAdministrationShopPage.newCashier.confirmPasswordInput.addValue("mono.123");
        MobileAdministrationShopPage.newCashier.firstnameInput.addValue("asdasd");
        MobileAdministrationShopPage.newCashier.lastNameInput.addValue("asdasd");
        MobileAdministrationShopPage.newCashier.emailInput.addValue(`${randomCashier}@summail.haer`);
        MobileAdministrationShopPage.newCashier.selectshop("HR Central", "MonoQA", "Vanja");
        $("span=Save").click();
        verifyIsVisible($("div=Cashier created successfully"));
        mobileAdministrationLogout();
    });
});

describe("DEPOSIT / WITHDRAWAL TESTS", () => {

    it("Open new Shop partner page, verify page does not crash", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.shopMenuItem.click();
        verifyIsVisible(MobileAdministrationShopPage.newCashierBtn);
        verifyIsVisible(MobileAdministrationShopPage.depositWithdrawalBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartnerBtn);
        verifyIsVisible(MobileAdministrationShopPage.shopManagementBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopBtn);
        MobileAdministrationShopPage.depositWithdrawalBtn.click();
    });

    it("Search all users, verify results are loaded", () => {
        MobileAdministrationShopPage.depositWithdrawal.searchBtn.click();
        verifyIsVisible($(".list--secondary"));
    });

    it("Select a user, verify user page is opened", () => {
        const firstFilteredResult = ".list--secondary__item:nth-of-type(1)";
        $(firstFilteredResult).click();
    });

    it("Deposit to account, verify request was a success", () => {
        const value20 = $(".btn--payment__wrapper").$("div=20");
        const depositSuccessfullMessage = $("div=Deposit successful");
        const withdrawalSuccessfullMessage = $("div=Withdrawal successful");

        value20.waitForClickable();
        value20.click();
        MobileAdministrationShopPage.depositWithdrawal.depositBtn.click();
        verifyIsVisible(depositSuccessfullMessage);

        MobileAdministrationShopPage.depositWithdrawal.payoutBtn.waitForClickable();
        MobileAdministrationShopPage.depositWithdrawal.payoutBtn.click();
        verifyIsVisible(withdrawalSuccessfullMessage);
        mobileAdministrationLogout();
    });

});
describe("SHOP MANAGEMENT TESTS", () => {

    it("Open new Shop partner page, verify page does not crash", () => {
        mobileAdministration();
        browser.setWindowSize(375, 812);
        MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
        MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
        MobileAdminLoginPage.signInBtn.click();
        mobileAdministrationSelectCompany("label=TW / sdg");
        MenuItemsPage.shopMenuItem.click();
        verifyIsVisible(MobileAdministrationShopPage.newCashierBtn);
        verifyIsVisible(MobileAdministrationShopPage.depositWithdrawalBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopPartnerBtn);
        verifyIsVisible(MobileAdministrationShopPage.shopManagementBtn);
        verifyIsVisible(MobileAdministrationShopPage.newShopBtn);
        MobileAdministrationShopPage.shopManagementBtn.click();
    });

    it("Select a shop", () => {
        MobileAdministrationShopPage.shopManagement.selectshop("HR Central", "MonoQA", "vShop");
        const shopName = $(".card--secondary__row--shop").$("div=vShop");
        const companyName = $(".card--secondary__row--company").$("div=TW");
        const centralName = $(".card--secondary__row--central").$("div=HR Central");
        const agencyName = $(".card--secondary__row--agency").$("div=MonoQA");
        verifyIsVisible(shopName);
        verifyIsVisible(companyName);
        verifyIsVisible(centralName);
        verifyIsVisible(agencyName);
    });

    it("Activate, deactivate shop", () => {
        MobileAdministrationShopPage.shopManagement.activeShopBtn.click();
        verifyIsVisible($("div=Shop deactivated successfully"));
        MobileAdministrationShopPage.shopManagement.inactiveShopBtn.waitForClickable();
        MobileAdministrationShopPage.shopManagement.inactiveShopBtn.click();
        verifyIsVisible($("div=Shop activated successfully"));
        mobileAdministrationLogout();
    });
});

