import { mobileAdministration } from "../../../../env/environment";
import { mobileAdministrationLogout, mobileAdministrationSelectCompany, randomStringNum, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MenuItemsPage, MobileAdministrationCommon, MobileAdministrationShopPage, MobileAdminLoginPage } from "../../../../pageobjects/mobile-administration";
describe("MOBILE ADMIN - SHOP", () => {
    describe("NEW SHOP TESTS", () => {

        it("Open new Shop page, verify page does not crash", () => {
            mobileAdministration();
            browser.setWindowSize(375, 812);
            MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
            MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
            MobileAdminLoginPage.signInBtn.click();
            mobileAdministrationSelectCompany("label=TW / sdg");
            MenuItemsPage.shopMenuItem.click();
            verifyIsVisible(MobileAdministrationShopPage.newCashierBtn);
            verifyIsVisible(MobileAdministrationShopPage.depositWithdrawalBtn);
            verifyIsVisible(MobileAdministrationShopPage.newShopPartnerBtn);
            verifyIsVisible(MobileAdministrationShopPage.shopManagementBtn);
            verifyIsVisible(MobileAdministrationShopPage.newShopBtn);
            MobileAdministrationShopPage.newShopBtn.click();
        });

        it("Select central, verify agencies are loaded", () => {
            MobileAdministrationShopPage.newShop.selectCentral("HR Central");
            verifyIsVisible(MobileAdministrationShopPage.newShop.centralTitle);
        });

        it("Create shop, verify it is a success", () => {
            const agency = $(".nav--linkbox--inline").$("span*=Automated");
            agency.waitForClickable();
            agency.click();
            MobileAdministrationShopPage.newShop.addNewShopBtn.click();
            const randomShop = `Autoshop${randomStringNum()}`;
            MobileAdministrationShopPage.newShop.shopNameInput.addValue(randomShop);
            MobileAdministrationShopPage.newShop.shopAddressInput.addValue("addrX");
            MobileAdministrationShopPage.newShop.pinNumberInput.addValue("1111");
            MobileAdministrationShopPage.newShop.saveBtn.click();
            verifyIsVisible(MobileAdministrationShopPage.newShop.shopCreatedToastMessage);

            const createdShop = $(".nav--linkbox--inline").$(`div*=${randomShop}`);
            createdShop.waitForDisplayed();
            verifyIsVisible(createdShop);

        });


    });
    describe("NEW SHOP PARTNER TESTS", () => {

        it("Open new Shop partner page, verify page does not crash", () => {

            MenuItemsPage.shopMenuItem.click();
            verifyIsVisible(MobileAdministrationShopPage.newCashierBtn);
            verifyIsVisible(MobileAdministrationShopPage.depositWithdrawalBtn);
            verifyIsVisible(MobileAdministrationShopPage.newShopPartnerBtn);
            verifyIsVisible(MobileAdministrationShopPage.shopManagementBtn);
            verifyIsVisible(MobileAdministrationShopPage.newShopBtn);
            MobileAdministrationShopPage.newShopPartnerBtn.click();
        });

        it("Verify shop partner creation page", () => {
            verifyIsVisible(MobileAdministrationShopPage.newShopPartner.usernameInput);
            verifyIsVisible(MobileAdministrationShopPage.newShopPartner.confirmPasswordInput);
            verifyIsVisible(MobileAdministrationShopPage.newShopPartner.passwordInput);
            verifyIsVisible(MobileAdministrationShopPage.newShopPartner.firstNameInput);
            verifyIsVisible(MobileAdministrationShopPage.newShopPartner.lastNameInput);
