            MobileAdministrationShopPage.newShopPartner.confirmPasswordInput.addValue('mono.123');
            MobileAdministrationShopPage.newShopPartner.firstNameInput.addValue("aeifha");
            MobileAdministrationShopPage.newShopPartner.lastNameInput.addValue("adfawf");
            MobileAdministrationShopPage.newShopPartner.selectshop("HR Central", "MonoQA", "Vanja");
            MobileAdministrationShopPage.newShopPartner.saveBtn.click();

            verifyIsVisible($("div*=Agency Partner created successfully"));

